MERGE 
	dbo.GeoRegion AS Target
USING 
    @GeoRegion AS Source 
ON 
    (Target.GeoRegionID = Source.GeoRegionID)
WHEN MATCHED 
    THEN UPDATE
        SET   
			Target.GeographicSchemaID = Source.GeographicSchemaID,
			Target.CorrectGeoRegionID = Source.CorrectGeoRegionID,
			Target.ParentGeoRegionID = Source.ParentGeoRegionID,

            Target.Name = Source.Name,
            Target.Language = Source.Language

WHEN NOT MATCHED BY TARGET 
    THEN INSERT      
        (GeoRegionID, GeographicSchemaID, CorrectGeoRegionID, ParentGeoRegionID, Name, Language)
    VALUES      
        (GeoRegionID, GeographicSchemaID, CorrectGeoRegionID, ParentGeoRegionID, Name, Language)

WHEN NOT MATCHED BY SOURCE 
    THEN DELETE
; 

GO

